export default function Map() {
    var ee = require('@google/earthengine');

    var CLIENT_ID = '783199902705-6380kgt5hno2jk7depl3pr4cmj0qdspt.apps.googleusercontent.com'
    // Authenticate using one (but not both) of the methods below.
    ee.data.authenticateViaOauth(CLIENT_ID);
    ee.data.authenticateViaPrivateKey(YOUR_PRIVATE_KEY);

    ee.initialize();

    // Run an Earth Engine script.
    var image = new ee.Image('srtm90_v4');
    image.getMap({min: 0, max: 1000}, function(map) {
        console.log(map);
    });

    return (
        <h1>My name is Nish</h1>
    )
}
